import axios from "axios"
import React  from "react"

const url = "http://localhost:8000/artists"
function Freelances() {
	const [post, setPost] = React.useState(null);

	React.useEffect(() => {
		axios.get(url).then((response) => {
			setPost(response.data);
		})
	}, [])
	if (!post) 
		return null;

    console.log(post)
    return(

		<div style={{
			display: 'flex',
			flexDirection: 'row',
			flexWrap: 'wrap',
			gap: '16px',
			justifyContent: 'center'
		  }}>
			<div style={{
				display: 'flex',
				flexDirection: 'column',
				width: '400px'
			}}>
				<img src={post[0].photo} alt="" />
				<h3>{post[0].name}</h3>
				<h6 style={{
					margin: '0'
				}}>{post[0].description}</h6>
				<p style={{
					fontSize: 'xx-small'
				}}>{post[0].bio}</p>
			</div>
		</div>
    )
}

export default Freelances
